import React from 'react';
import palette from '../../lib/styles/palette';
import Button from '../common/Button';
import styled from 'styled-components';



const BackTemplate=styled.div`

position:absolute;
left:0;
right:0;
top:0;
bottom:0;

background:${palette.gray[2]};
padding-left:10px;
padding-right:10px;
padding:10px;



`;

const ContentBody=styled.div`

height:100%;
border-top:2rem;


display:flex;
flex-direction:row;
flex-wrap:nowrap; // 한줄에 표사
justify-content:flex-start;
alignItems:center;
`;

const ListBackTemplate=styled.div`

width:30%;
background:${palette.gray[5]};
border-right:1px solid black;
`;


const TableBackTemplate=styled.div`

width:70%;
background:${palette.gray[9]};

`;

const TimeTable=styled.div`

width:50%;
height:70%;

background:${palette.gray[5]};

border-top:1px solid black;
border-right:1px solid black;
border-left:1px solid black;
border-bottom:1px solid black;


position:relative;
overflow:hidden;


`;

const RowZero=styled.div`

width:100%;
height:9%;

border-bottom:1px solid black;

background:#BCF5A9;

display:flex;
flex-direction:row;



`;

const Blank=styled.span`


width:5%;
background:black;
border-left:1px solid black;

`;

const ItemBox=styled.div`

width:19%;
height:100%;
border-left:1px solid black;

text-align:center;

font-weight:bold;



`;

// const ColumnTitle=styled.div`

// width:5%;
// height:100%;

// background:#BCF5A9;


// `;

const Graph=()=>{


    return (
        
    <BackTemplate>
        <TimeTable>
        
        <RowZero>
        <Blank></Blank>
        <ItemBox>월</ItemBox>
        <ItemBox>화</ItemBox>
        <ItemBox>수</ItemBox>
        <ItemBox>목</ItemBox>
        <ItemBox>금</ItemBox>
        </RowZero>


        
        </TimeTable>
     </BackTemplate>
    
    );
}



export default Graph;
